-- A fictional database of diseases and vaccines, built for an exam in a database course
-- (c) 2020-2021, Bjorn Thor Jonsson, IT University of Copenhagen

-- List of companies from: https://en.wikipedia.org/wiki/List_of_largest_biomedical_companies_by_revenue
-- Lists of diseases and categories are small subsets from: https://www.malacards.org/categories
-- Everything else is randomly generated to create an examination database

DROP TABLE IF EXISTS Injections;
DROP TABLE IF EXISTS Vaccines;
DROP TABLE IF EXISTS People;
DROP TABLE IF EXISTS Companies;
DROP TABLE IF EXISTS Diseases;
DROP TABLE IF EXISTS Categories;

CREATE TABLE Categories (
  ID INT PRIMARY KEY,
  name VARCHAR NOT NULL
);

CREATE TABLE Diseases (
  ID INT PRIMARY KEY,
  catID INT NOT NULL REFERENCES Categories(ID),
  code VARCHAR NOT NULL,
  name VARCHAR NOT NULL,
  curable BOOLEAN NOT NULL
);

CREATE TABLE Companies (
  ID INT PRIMARY KEY,
  name VARCHAR NOT NULL,
  country VARCHAR NOT NULL
);

CREATE TABLE People (
  ID INT PRIMARY KEY,
  name VARCHAR NOT NULL,
  birthyear INT
);

CREATE TABLE Vaccines (
  ID INT PRIMARY KEY,
  name VARCHAR NOT NULL,
  disID INT NOT NULL REFERENCES Diseases(ID),
  comID INT NOT NULL REFERENCES Companies(ID),
  effectyears INT NOT NULL
);

CREATE TABLE Injections (
  peoID INT REFERENCES People(ID),
  vacID INT REFERENCES Vaccines(ID),
  injectionyear INT NOT NULL,
  PRIMARY KEY (peoID, vacID, injectionyear)
);

